import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { isTemplateElement } from '@babel/types';

// 两种定义方式
// 传统方式
class App extends Component{

  render(){
    const todoList = [
      "react practice",
      "game time"
    ]
    return (
      <div className="App">
      <h2>Todo List</h2>
      {
        todoList.map(item => <p>{item}</p>)
      }      
      </div>
    );
  }
}
